window.bookSummaryJSON = "<p><b>George is a legendary hero...wait, no. George is an incredibly powerful sorcerer...also no?</b></p> <p>Okay, fine. George is an unremarkable human bard who made a promise a long time ago. A promise that set him on a path to find the remains of Simantiar, the greatest wizard who ever lived. Though all that was left were bones, Simantiar was still very much alive and quite...underwhelming.</p> <p>This is their story: <i>The Fantastically Underwhelming Epic </i>of a dead wizard and an average bard.</p>"; 
